window.bookSummaryJSON = "<p>On the technological, decadent world of Proton, someone was trying to destroy Stile, serf and master Gamesman. His only escape lay in Phaze, a world totally ruled by magic. Soon he learned that his alternate self had already been murdered, and that he was next. On Proton, his fate depended on winning the great Games. On Phaze, he must master magic to survive. And if he used any magic at all, his friends were determined to kill him at once!</p>"; 
